- input: "TEXT\x1CC00482828\x1C.TEXT\x1C\x1CF3A\x1COriginal report of loan from candidate
    was filed incorrectly.  The original 48-hour report of the loan made by the candidate
    to his committee included a C-1 report, showing the candidate had used borrowed
    funds to loan to the committee.  This was incorrect.  The candidate used personal
    funds that were at his disposal, not those borrowed from a lending instititution.
    \ Once the error was discovered, we tried to correct it but were advised that
    this could not be done, once the C-1 and 48-hour report had been created.  In
    order to comply with e-file parameters, we completed all required fields for the
    C-1 report.  However, the information enetered in the C-1 report is not applicable,
    as it should not have been prepared in the first place.\n"
